import '../App.css'
import {
    LineChart,
    ResponsiveContainer,
    Legend, Tooltip,
    Line,
    XAxis,
    YAxis,
    CartesianGrid
} from 'recharts';

const Board= () => { 
    return(  
<div className='cards'>
        <div class="card1">
            <h4>Todays Sales</h4>
            <p>90000</p>
            <div class="per">
            </div>

        </div>

        <div class="card2">
            <h4>Total Payments</h4>
            <p>10000</p>
            <div class="per">
            </div>

        </div>


        <div class="card3">
            <h4>Total Users</h4>
            <p>70000</p>
            <div class="per">
            </div>

        </div>

        <div class="card4">
            <h4>Orders</h4>
            <p>700</p>
            <div class="per">
            </div>

        </div>

        <h1 className="text-heading">
                Line Chart Using Rechart
            </h1>
            <ResponsiveContainer width="100%" aspect={3}>
                <LineChart data={pdata} margin={{ right: 300 }}>
                    <CartesianGrid />
                    <XAxis dataKey="name" 
                        interval={'preserveStartEnd'} />
                    <YAxis></YAxis>
                    <Legend />
                    <Tooltip />
                    <Line dataKey="student"
                        stroke="black" activeDot={{ r: 8 }} />
                    <Line dataKey="fees"
                        stroke="red" activeDot={{ r: 8 }} />
                </LineChart>
            </ResponsiveContainer>



    </div>

) 
}
 export default Board;
